import React, { useState } from 'react';
import Product from './Product';

var data = -1; 
try {
    fetch('http://localhost:3002/')
  .then(response => response.json())
  .then(data => data);

} catch (error) {

    console.error(error);
}
var arr = [];
Object.keys(data).forEach(function(key) {
    arr.push(data[key]);
});
// console.log(arr[0]);
